import React from 'react';
import { NavLink } from 'react-router-dom';
import img2 from '../src/images/img6.jpg';
const About=()=>{
    return(
    <>
       <section id="header" className="d-flex align-items-center">
        <div className="container-fluid nav-bg">
            <div className='row'>
                <div className="col-10 mx-auto">
                <div className="row">
                    <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                        <h1>Welcome to About Page</h1>
                        <h2 className="my-3">We are a team of talented developers</h2>
                        <div className="mt-3">
                            <NavLink className="btn-get-started" to="/contact">Contact</NavLink>
                        </div>
                    </div>
                    <div className="col-lg-6 order-1 order-lg-2 header-img">
                        <img src={img2} className="img-fluid animated" alt="img"/>
                    </div>
                    </div>
                </div>
            </div>
        </div>
        </section>
    </>
    );
}
export default About;
